namespace Movys.Data.Seeding
{
    using System;
    using System.Collections.Generic;
    using System.Linq;
    using System.Text;
    using System.Threading.Tasks;

    using Movys.Data.Models;

    public class ProfilePicturesSeeder : ISeeder
    {
        public async Task SeedAsync(ApplicationDbContext dbContext, IServiceProvider serviceProvider)
        {
            if (!dbContext.ProfilePictures.Any())
            {
                var userId = dbContext.Users.Select(x => x.Id).First();
                var pic = new ProfilePicture
                {
                    Id = Guid.NewGuid().ToString(),
                    UploadDate = DateTime.UtcNow,
                    Content = Encoding.ASCII.GetBytes(""),
                    Size = 28629,
                    UserId = userId,
                };

                await dbContext.ProfilePictures.AddAsync(pic);
            }
        }
    }
}
